import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import AdminTemplate from "../../../templates/AdminTemplate";
import useMascotaViewModel from "../../../viewmodels/useMascotaViewModel";
import Button from "../../../components/atoms/Button";

const NuevaMascota = () => {
  const navigate = useNavigate();
  const { createMascota } = useMascotaViewModel(); // ← ahora NO usamos cliente fijo

  const [formData, setFormData] = useState({
    rut: "",
    nombre: "",
    especie: "",
    raza: "",
    edad: "",
    peso: "",
  });

  const handleChange = (e) => {
    const { id, value } = e.target;
    setFormData((prev) => ({ ...prev, [id]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    await createMascota(
      formData.rut,   // ← pasamos el rut/ID del cliente
      {
        nombre: formData.nombre,
        especie: formData.especie,
        raza: formData.raza,
        edad: formData.edad,
        peso: formData.peso,
      }
    );

    navigate("/admin/clientes/mascotas/listar");
  };

  return (
    <AdminTemplate>
      <main className="flex-grow-1" id="main-content">
        <div className="container-fluid py-4">

          <nav aria-label="breadcrumb" className="mb-3">
            <ol className="breadcrumb mb-0">
              <li className="breadcrumb-item"><a href="/Admin">Administración</a></li>
              <li className="breadcrumb-item"><a href="/admin/clientes/mascotas">Mascotas</a></li>
              <li className="breadcrumb-item active">Nueva Mascota</li>
            </ol>
          </nav>

          <div className="bg-white p-4 shadow-sm rounded">

            {/* -------------------------- */}
            {/* CAMPO RUT/ID DEL CLIENTE */}
            {/* -------------------------- */}
            <div className="mb-3">
              <label htmlFor="rut">RUT / ID Cliente *</label>
              <input
                id="rut"
                type="text"
                required
                className="form-control"
                placeholder="000000000000000000000001"
                value={formData.rut}
                onChange={handleChange}
              />
            </div>

            {/* Nombre */}
            <div className="mb-3">
              <label htmlFor="nombre">Nombre *</label>
              <input
                id="nombre"
                type="text"
                required
                className="form-control"
                value={formData.nombre}
                onChange={handleChange}
              />
            </div>

            {/* Especie */}
            <div className="mb-3">
              <label htmlFor="especie">Especie *</label>
              <input
                id="especie"
                type="text"
                required
                className="form-control"
                value={formData.especie}
                onChange={handleChange}
              />
            </div>

            {/* Raza */}
            <div className="mb-3">
              <label htmlFor="raza">Raza *</label>
              <input
                id="raza"
                type="text"
                required
                className="form-control"
                value={formData.raza}
                onChange={handleChange}
              />
            </div>

            {/* Edad */}
            <div className="mb-3">
              <label htmlFor="edad">Edad *</label>
              <input
                id="edad"
                type="number"
                required
                className="form-control"
                value={formData.edad}
                onChange={handleChange}
              />
            </div>

            {/* Peso */}
            <div className="mb-3">
              <label htmlFor="peso">Peso (kg) *</label>
              <input
                id="peso"
                type="number"
                required
                className="form-control"
                value={formData.peso}
                onChange={handleChange}
              />
            </div>

            <Button label="Registrar Mascota" type="submit" onClick={handleSubmit} />

          </div>
        </div>
      </main>
    </AdminTemplate>
  );
};

export default NuevaMascota;
